    PRIMARY KEY (`id`) USING BTREE,
    UNIQUE KEY `uk_code` (`code`) USING BTREE,
    KEY              `ix_code` (`code`) USING BTREE,
    KEY              `ix_parent_id` (`parent_id`) USING BTREE
